Read the value of RCC_CR register: let val = rcc_cr.load(); HSIRDY is a single-bit field, so this method returns a bool value indicating whether the corresponding bit is set or cleared: val.hsirdy() // equivalent to `val & (1 << 1) != 0` HSITRIM is a 5-bit field in the middle of the RCC_CR register. This method returns an integer of only this field bits shifted to the beginning: val.hsitrim() // equivalent to `(val >> 3) & ((1 << 5) - 1)` Reset the register RCC_CR to its default value, which is specified in the reference manual: rcc_cr.reset(); The following line writes a new value to the RCC_CR register. The value is the register default value, except HSION is set to 1 and HSITRIM is set to 14. rcc_cr.store(|r| r.set_hsion().write_hsitrim(14));
// Besides "set_", there are "clear_" and "toggle_" prefixes
// for single-bit fields. And finally the following line is a combination of all of the above, it performs read-modify-write operation: rcc_cr.modify(|r| r.set_hsion().write_hsitrim(14)); Unlike store, which resets unspecified fields to the default, the modify method keeps other field values intact.

